import React, { Component } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios'
import Map from '../components/Map'

export default class Region extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state

        return (
            <div>
                <Use
                    list={prop}
                />

            </div>
        )
    }
}

function Use(props) {
    let { id } = useParams();
    const zoomP = 13
    const heightP = 300

    return (
        <div>
            {props.list.map(item => {
                if (id == item.id) {
                    return (
                        <div key={item.id}>
                            <h1>
                                {item.tittle}
                            </h1>
                            <Map
                                lat={item.lat}
                                long={item.long}
                                zoom={zoomP}
                                popup={item.tittle}
                                height={heightP}
                            />
                        </div>
                    )
                }
            })}
        </div>
    );
}
